import React from 'react';
import {Github} from 'react-bootstrap-icons'

const Footer = () => {
    return (
        <>
            <footer className='fixed-bottom'>
                <div>
                    &copy; 2022 Copyright: David Wong
                </div>
            </footer>
        </>
    )
}

export default Footer;
